 updaten van bestellingen niet.','New custom field name'=>'Nieuwe aangepaste veldnaam','Please review the errors above.'=>'Beoordeel de fouten hierboven.','WooCommerce Blocks development mode requires files to be built. From the root directory, run %1$s to ensure your node version is aligned, run %2$s to install dependencies, %3$s to build the files or %4$s to build the files and watch for changes.'=>'De WooCommerce Blocks ontwikkelmodus vereist dat bestanden worden gebouwd. Voer vanuit de hoofdfolder %1$s uit om ervoor te zorgen dat je node-versie is afgestemd, voer %2$s uit om afhankelijkheden te installeren, voer %3$s uit om de bestanden te bouwen of voer %4$s uit om de bestanden te bouwen en te kijken of er wijzigingen zijn.','Overriding existing data with an already registered key is not allowed'=>'Bestaande gegevens overschrijven met een reeds geregistreerde sleutel is niet toegestaan','Key for the data being registered must be a string'=>'Sleutel voor de geregistreerde gegevens moet een string zijn','The metaboxhidden_product meta from the user metas.'=>'De metaboxhidden_product meta uit de gebruikersmeta\'s.','Set up your payment methods and accept credit and debit cards, cash, bank transfers and money from your Mercado Pago account. Offer safe and secure payments with Latin America’s leading processor.'=>'Stel je betaalmethoden in en accepteer credit- en debitcards, contant geld, bankoverschrijvingen en geld van je Mercado Pago account. Bied veilige en beveiligde betalingen met de toonaangevende betalingsverwerker van Latijns-Amerika.','Mercado Pago'=>'Mercado Pago','Collect sales tax'=>'Omzetbelasting innen','Add your products'=>'Voeg je producten toe','Grow your business'=>'Laat je bedrijf groeien','It\'s time to celebrate – you\'re ready to launch your store! Woo! Hit the button to preview your store and make it public.'=>'Het is tijd om te feestvieren - je bent klaar om je winkel te lanceren! Woo! Klik op de knop om een voorbeeld van je winkel te bekijken en deze openbaar te maken.','Launch your store'=>'Lanceer je winkel','Get your products shipped'=>'Je producten laten verzenden','Current price is: %s.'=>'Huidige prijs is: %s.','Original price was: %s.'=>'Oorspronkelijke prijs was: %s.','Checkout can be customized <a href="%s">in the Editor</a> with your active theme.'=>'Afrekenen kan worden aangepast <a href="%s">in de editor</a> met je actieve thema.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce heeft geprobeerd <a href="%1$s">de Legacy REST API plugin</a> te installeren, omdat deze site <a href="%2$s">de Legacy REST API heeft ingeschakeld</a> of <a href="%3$s">verouderde webhooks heeft gedefinieerd</a>, maar de installatie is mislukt (zie fout details in <a href="%4$s">de WooCommerce logs</a>). Installeer en activeer de plugin handmatig. <a href="%5$s">Meer informatie</a>','ℹ️ WooCommerce installed and activated <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>. <a href="%4$s">More information</a>'=>'ℹ️ WooCommerce heeft <a href="%1$s">de Legacy REST API plugin</a> geïnstalleerd en geactiveerd omdat op deze site <a href="%2$s">de verouderde REST API is ingeschakeld</a> of <a href="%3$s">verouderde webhooks zijn gedefinieerd</a>. <a href="%4$s">Meer informatie</a>','WooCommerce installed the Legacy REST API plugin but failed to activate it, see context for more details.'=>'WooCommerce heeft de Legacy REST API plugin geïnstalleerd maar is er niet in geslaagd deze te activeren, zie de context voor meer gegevens.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce heeft <a href="%1$s">de Legacy REST API plugin</a> geïnstalleerd, omdat deze site <a href="%2$s">de Legacy REST API heeft ingeschakeld</a> of <a href="%3$s">verouderde webhooks heeft gedefinieerd</a>, maar het activeren is mislukt (zie fout details in <a href="%4$s">de WooCommerce logs</a>). Ga naar <a href="%5$s">de plugins pagina</a> en activeer hem handmatig. <a href="%6$s">Meer informatie</a>','Please enter a valid email at checkout to use coupon code "%s".'=>'Voer bij het afrekenen een geldig e-mailadres in om waardeboncode "%s" te gebruiken.','Please enter a valid email to use coupon code "%s".'=>'Voer een geldig e-mailadres in om waardeboncode "%s" te gebruiken.','To allow logging, make %s writable.'=>'Om loggen mogelijk te maken, maak %s schrijfbaar.','Local pickup: Set up pickup locations in the <a href="%s">Local pickup settings page</a>.'=>'Lokaal afhalen: stel afhaallocaties in op de <a href="%s">lokaal afhalen instellingenpagina</a>.','Explore a new enhanced delivery method that allows you to easily offer one or more pickup locations to your customers in the <a href="%s">Local pickup settings page</a>.'=>'Verken een nieuwe, verbeterde bezorgmethode waarmee je eenvoudig een of meer afhaallocaties aan je klanten kunt aanbieden op de <a href="%s">lokaal afhalen instellingenpagina</a>.','Gathering usage data allows us to tailor your store setup experience, offer more relevant content, and help make WooCommerce better for everyone.'=>'Het verzamelen van gebruiksgegevens stelt ons in staat om je winkel op maat in te stellen, relevantere inhoud te bieden en WooCommerce beter te maken voor iedereen.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'Installeer de <a href="%1$s">WooCommerce.com Update Manager</a> om door te gaan met het ontvangen van updates en gestroomlijnde ondersteuning die bij je WooCommerce.com abonnementen horen. Je kunt het ook <a href="%2$s">downloaden</a> en handmatig installeren.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'Activeer de <a href="%1$s">WooCommerce.com Update Manager</a> om door te gaan met het ontvangen van updates en gestroomlijnde ondersteuning die bij je WooCommerce.com-abonnementen horen.',' Activate WooCommerce.com Update Manager to update.'=>' Activeer WooCommerce.com Update Manager om te updaten.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Installeer WooCommerce.com Update Manager</a> om te updaten.','block keywordrich-text'=>'rich-text','block keywordtextarea'=>'tekstgebied','block descriptionA text-area field for use in the product editor.'=>'Een tekstgebied voor gebruik in de producteditor.','block titleProduct textarea block'=>'Product tekstgebied blok','block keywordsubsection'=>'subonderdeel','block descriptionThe product subsection description.'=>'Het onderdeel productbeschrijving.','block titleProduct subsection description'=>'Productbeschrijvingsonderdeel','Invalid %s provided.'=>'Ongeldige %s verstrekt.','Internal server error'=>'Interne serverfout','Sorry, you cannot delete resources.'=>'Je kunt geen gegevensbronnen verwijderen.','Sorry, you cannot create resources.'=>'Je kunt geen gegevensbronnen aanmaken.','Sorry, you cannot view resources.'=>'Je kunt geen gegevensbronnen bekijken.','True to force the creati