euwer nodig om deze tool te kunnen gebruiken.','The active version of WooCommerce does not support template cache clearing.'=>'De actieve versie van WooCommerce ondersteunt het wissen van de template cache niet.','Template cache cleared.'=>'Template cache gewist.','Verify if all base database tables are present.'=>'Verifieer of alle basis-databasetabellen aanwezig zijn.','Verify database'=>'Verifieer database','Verify base database tables'=>'Verifieer basis-databasetabellen','This tool will empty the template cache.'=>'Met dit gereedschap wordt de template cache geleegd.','Clear template cache'=>'Template cache wissen','Collect and validate EU VAT numbers at checkout'=>'Verzamel en valideer EU btw-nummers bij het afrekenen','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Als je winkel zich in de EU bevindt, raden we je aan de extensie EU btw-nummer te gebruiken als aanvulling op geautomatiseerde belastingen. Tijdens het afrekenen wordt er dan een veld weergegeven waarmee je het EU btw-nummer van een klant kunt verzamelen en valideren als ze er een hebben.','Get real-time order alerts anywhere'=>'Verkrijg overal realtime waarschuwingen voor bestellingen','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Ontvang meldingen over de winkelactiviteit, zoals nieuwe bestellingen en productbeoordelingen op je mobiele apparaten met de Woo app.','First order received'=>'Eerste bestelling ontvangen','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Deze videotutorial helpt je bij het toevoegen van je eerste product aan WooCommerce.','Do you need help with adding your first product?'=>'Hulp nodig bij het toevoegen van je eerste product?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Een mode site starten is spannend, maar het kan ook wat overweldigend lijken. In dit artikel helpen we je bij het setup proces, leren we je hoe je succesvolle product vermeldingen kunt maken en laten we zien hoe je je producten aan je ideale doelgroep kunt aanbieden.','Start your online clothing store'=>'Begin je online kledingwinkel','The admin note layout has a wrong prop value.'=>'De lay-out van de beheerder notitie heeft een verkeerde prop-waarde.','Watch tutorial'=>'Bekijk tutorial','Share feedback'=>'Deel je feedback','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Nu je ons hebt gekozen als partner is het ons doel om te zorgen dat wij je van de juiste gereedschappen kunnen voorzien om aan je behoeften te voldoen. We kijken ernaar uit om je feedback over de winkel setup te lezen, zodat we deze in de toekomst kunnen verbeteren.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Het overschakelen tussen eCommerce-platformen lijkt misschien een lastige stap, maar het is eenvoudiger dan je zou denken om je producten, klanten en bestellingen naar WooCommerce te verplaatsen. Dit artikel helpt je bij dit proces.','Do you want to migrate from Shopify to WooCommerce?'=>'Wil je van Shopify naar WooCommerce migreren?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscri