h verlengen in om updates en toegang tot ondersteuning te blijven houden.','%s subscription expiring soon'=>'%s abonnement verloopt binnenkort','Install Woo mobile app'=>'Installeer de Woo app voor mobiel','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.'=>'Installeer de mobiele app van WooCommerce om bestellingen te beheren, meldingen over verkopen te ontvangen en belangrijke statistieken te bekijken - waar je ook bent.','New sales record!'=>'Nieuw omzetrecord!','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Geweldig, %1$s was je recorddag voor verkopen! De nettoverkoop was %2$s en verbeterde het vorige record van %3$s dat op %4$s was gevestigd.','Review your orders'=>'Je bestellingen controleren','Browse'=>'Bladeren','Another order milestone! Take a look at your Orders Report to review your orders to date.'=>'Wederom een mijlpaal wat betreft bestellingen! Bekijk het rapport van je bestelling.','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Je hebt de mijlpaal van 10 bestellingen bereikt! Je bent op dreef. Bekijk een aantal WooCommerce succesverhalen voor inspiratie.','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Gefeliciteerd met je eerste bestelling! Dit is een geweldig moment om te ontdekken hoe je je bestellingen beheert.','Congratulations on processing %s orders!'=>'Gefeliciteerd met het verwerken van %s bestellingen!','Review'=>'Beoordeling','Activate usage tracking'=>'Activeer gebruiksgegevens volgen','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what da