e die noodzakelijk is om de betaling te verwerken of ondersteunen, zoals het totaalbedrag van de aankoop en factuurgegevens.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'In deze subsectie moet je vermelden welke betalingsverwerker van derden je gaat gebruiken voor betalingen op je site, aangezien hier klantgegevens aan gebonden kunnen zijn. We hebben PayPal als voorbeeld toegevoegd, maar je zult deze moeten verwijderen als je geen gebruikmaakt van PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'We delen informatie met derden die ons helpen onze bestellingen te leveren en diensten aan je op te slaan; bijvoorbeeld --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'In deze sectie moet je vermelden met wie je gegevens deelt en met welk doel. Hiertoe kan onder andere het volgende behoren: analyse, marketing, gateways voor betaling, bezorgdiensten en insluitingen van derden.','What we share with others'=>'Wat we delen met anderen','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Onze teamleden hebben toegang tot deze informatie om bestellingen te voltooien, te behandelen, terugbetalingen te doen en om je te ondersteunen.','Customer information like your name, email address, and billing and shipping information.'=>'Klantinformatie, zoals je naam, e-mailadres, verzend- en betaalinformatie.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Informatie over bestellingen, zoals wat er is gekocht, wanneer het is gekocht en waar het naartoe verzonden moet worden, en','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Leden van ons team hebben toegang tot de informatie die je bij ons hebt opgegeven. Zowel Beheerders als Winkelmanagers hebben bijvoorbeeld toegang tot:','Who on our team has access'=>'Wie van ons team heeft toegang','We will also store comments or reviews, if you choose to leave them.'=>'Wij zullen ook reacties of beoordelingen opslaan, indien je deze achterlaat.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Over het algemeen slaan we informatie over je op zolang we deze nodig hebben voor het doel waarvoor we deze verzamelen en gebruiken. We zijn niet wettelijk vereist deze te bewaren. We bewaren bestelinformatie bijvoorbeeld XXX jaar voor belasting- en boekhoudingsdoeleinden. Tot deze informatie behoort je naam, e-mailadres, en factuur- en verzendadres.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Als je een account aanmaakt, worden je naam, adres, e-mailadres en telefoonnummer gebruikt om de afrekengegevens automatisch in te vullen bij toekomstige bestellingen.','Send you marketing messages, if you choose to receive them'=>'Om marketingberichten naar je te sturen, als je hiervoor kiest','Improve our store offerings'=>'Om ons winkelaanbod te verbeteren','Comply with any legal obligations we have, such as calculating taxes'=>'Voldoe aan alle wettelijke verplichtingen die we hebben, zoals het berekenen van belastingen','Set up your account for our store'=>'Om je account voor onze winkel in te stellen','Process payments and prevent fraud'=>'Om betalingen te verwerken en fraude te voorkomen','Respond to your requests, including refunds and complaints'=>'Om te reageren op je aanvragen, waaronder restituties en klachten','Send you information about your account and order'=>'Om je informatie toe te sturen over je account en bestelling','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Wanneer je producten bij ons aanschaft, vragen we je om informatie te verstrekken, waaronder je naam, factuuradres, verzendadres, e-mailadres, telefoonnummer, creditcard-/betalingsgegevens en optionele accountgegevens, zoals een gebruikersnaam en wachtwoord. We gebruiken deze informatie voor de volgende doeleinden:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Opmerking: je kunt je cookiebeleid gedetailleerd beschrijven en hier een link naar dat sectie toevoegen.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'We gebruiken cookies ook om producten in je winkelwagen op te slaan terwijl je door onze site bladert.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Verzendadres: we vragen je om deze gegevens in te vullen, zodat we bijvoorbeeld de verzendkosten kunnen berekenen voordat je een bestelling plaatst en om de bestelling vervolgens naar je te verzenden!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Locatie, IP-adres en browsertype: we gebruiken deze gegevens om belastingtoeslagen en verzendkosten te berekenen','Products you’ve viewed: we’ll use this to, for example, show 